import React from "react";

const Hero = () => {
  return (
    <section
      id="hero"
      className="h-screen flex flex-col justify-center items-center bg-gradient-to-r from-blue-500 to-indigo-500 text-white text-center"
    >
      <h1 className="text-5xl font-bold mb-6">Welcome to QuickRent</h1>
      <p className="text-xl mb-6">Rent the gadgets you need, hassle-free.</p>
      <button className="bg-white text-blue-500 px-6 py-3 rounded font-bold hover:bg-gray-200">
        Explore Rentals
      </button>
    </section>
  );
};

export default Hero;
